Plot:

Badshah Babar arrives in India from Iran, drives out Ibrahim Lodhi, makes peace with the Hindus and rules Delhi. He also adopts Rajkumari as his daughter and treats like his very own child, even though he has two sons, Humayun and Kamran, and a daughter, Gulbadan. Babar also finds out that Rajkumari is soon to be married to Randhir, the Rajkumar of Chanderi, who is out to avenge the conquest of his native land, by killing Humayun. Before that could happen Humayun falls seriously ill, Babar prays for his survival, but himself becomes ill and passes away, leaving Humayun to recuperate and be crowned the next Badshah. Humayun meets Hamida Bano and both fall in love with each other so much so that he loses all interest in the running of the state. When Delhi is attacked by Jai Singh, Kamran and Khan Bahadur join in the attack, forcing Hamida to flee. Humayun fends off the attackers, but must re-route his armies when Rajkumari is taken hostage...

